void SuiFont::DeleteInstance()
{
	if(_ref)
	{
		delete _ref;
		_ref = NULL;
	}
}

SuiFont::~SuiFont()
{
	if(_textureID != 0)
		glDeleteTextures( 1, &_textureID);

	for( int i=0; i<(int)_normalFontVec.size(); i++ )
	{
		if( _normalFontVec[i] )
		{
			delete _normalFontVec[i];
			_normalFontVec[i] = NULL;
		}
	}
	_normalFontVec.clear();

	if(_data)
	{
		delete _data;
		_data = NULL;
	}
}